import React, { Component } from 'react';

const withGatewayToken = (Wrapped) => {

	class HOC extends Component {
		render() {
			return (
				<Wrapped 
					{...this.props}
					gatewayToken = {456456456}
				/>
			);
		}
	}

	return HOC;
}

